    public final int getScopeSize() { return SCOPE_SIZE; }
    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 544,
           NT_OFFSET         = 122,
           LA_STATE_OFFSET   = 5969,
           MAX_LA            = 2147483647,
           NUM_RULES         = 537,
           NUM_NONTERMINALS  = 204,
           NUM_SYMBOLS       = 326,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 623,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 120,
           EOLT_SYMBOL       = 120,
           ACCEPT_ACTION     = 5067,
           ERROR_ACTION      = 5432;

